import React, { useState, useEffect } from 'react';

import axios from 'axios';

function App() {
    const [data, setData] = useState(null);

    useEffect(() => {
        getCorona(); //LOL

    }, []);

    async function getCorona() {
        let result = await axios.get('https://coronavirus-tracker-api.herokuapp.com/all');

        setData(result)
    }

    return (
    <div>
        <h1>CORONA</h1>
        {data.confirmed}
    </div>
    );
}

export default App;
